ww.energyrecovery.com","https://www.resmed.com","https://www.atecspine.com","https://www.caesarstone.com","https://www.mondelezinternational.com","https://www.dropbox.com","https://www.enterprisebanking.com","https://www.aethlonmedical.com","https://www.cogentco.com","https://www.airproducts.com","https://www.daxor.com","https://www.accolade.com","https://www.accolade.com","https://www.accolade.com","https://www.accolade.com","https://www.foxcorporation.com","https://www.thefirstbank.com","https://www.thefirst.com","https://www.fibk.com",null,"https://www.canadiansolar.com","https://www.steelconnectinc.com","https://www.commscope.com","https://cvgrp.com","https://www.docgo.com","https://www.cumberlandpharma.com","https://cricut.com","https://arqit.uk"],"shape":[79],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["Halliburton Company provides products and services to the energy industry worldwide. It operates in two segments, Completion and Production, and Drilling and Evaluation. The Completion and Production segment offers production enhancement services that include stimulation and sand control services; cementing services, such as well bonding and casing, and casing equipment; completion tools that offer downhole solutions and services, including well completion products and services, intelligent well completions, and service tools, as well as liner hanger, sand control, and multilateral systems; production solutions comprising coiled tubing, hydraulic workover units, downhole tools, and pumping and nitrogen services; and pipeline and process services, such as pre-commissioning, commissioning, maintenance, and decommissioning. This segment also provides electrical submersible pumps, as well as artificial lift services. The Drilling and Evaluation segment offers drilling fluid systems, performance additives, completion fluids, solids control, specialized testing equipment, and waste management services; oilfield completion, production, and downstream water and process treatment chemicals and services; drilling systems and services; wireline and perforating services consists of open-hole logging, and cased-hole and slickline; and drill bits and services comprising roller cone rock bits, fixed cutter bits, hole enlargement, and related downhole tools and services, as well as coring equipment and services. This segment also provides cloud based digital services and artificial intelligence solutions on an open architecture for subsurface insights, integrated well construction, and reservoir and production management; testing and subsea services, such as acquisition and analysis of reservoir information and optimization solutions; and project management and integrated asset management services. Halliburton Company was founded in 1919 and is based in Houston, Texas.","Canterbury Park Holding Corporation, through its subsidiaries, engages in horse racing, card casino, food and beverage, and real estate development businesses. The company's Horse Racing segment operates year-round simulcasting of horse races, as well as wagering on live thoroughbred and quarter horse races on a seasonal basis. Its Card Casino segment offers unbanked card games, such as poker and table games. The company's Food and Beverage segment operates concession stands, restaurants and buffets, bars, and other food venues, as well as caf\u00e9 style restaurants and full-service bars within the Card Casino and simulcast area. This segment also provides lounge services along with a buffet restaurant; various concession style food and beverages during live racing; and catering and events services. Its Development segment engages in various development opportunities, such as residential development, office, restaurants, hotel, entertainment, and retail operations. The company is also involved in the provision of related services and activities, such as parking, advertising signage, publication sales, and other entertainment events and activities. Canterbury Park Holding Corporation was founded in 1994 and is based in Shakopee, Minnesota.","Align Technology, Inc., a medical device company, designs, manufactures, and markets Invisalign clear aligners and iTero intraoral scanners and services for orthodontists and general practitioner dentists, and restorative and aesthetic dentistry. It operates in two segments, Clear Aligner; and Scanners and Services. The Clear Aligner segment consists of comprehensive products, including Invisalign comprehensive treatment that addresses the orthodontic needs of teenage patients, such as mandibular advancement, compliance indicators, and compensation for tooth eruption; and Invisalign First Phase I and Invisalign First Comprehensive Phase 2 package for younger patients generally between the ages of seven and ten years, which is a mixture of primary/baby and permanent teeth. This segment's non-comprehensive products comprise Invisalign moderate, lite and express packages, and Invisalign go; and non-case products include retention products, Invisalign training fees, and sales of ancillary products, such as cleaning material, and adjusting tools used by dental professionals during the course of treatment. The Scanners and Services segment offers iTero scanner, a single hardware platform with software options for restorative or orthodontic procedures; restorative software for general practitioner dentists, prosthodontists, periodontists, and oral surgeons; and software for orthodontists for digital records storage, orthodontic diagnosis, and for the fabrication of printed models and retainers. This segment also provides computer-aided design and computer-aided manufacturing services; ancillary products, such as disposable sleeves for the wand; iTero model and dies; third party scanners and digital scans; Invisalign outcome simulator, a chair-side and cloud-based application for the iTero scanner; Invisalign progress assessment tool; and TimeLapse technology, which allows doctors or practitioners to compare a patient's historic 3D scans to the present-day scan. The company sells its products in the United States, Switzerland, China, and internationally. Align Technology, Inc. was incorporated in 1997 and is headquartered in Tempe, Arizona.","Ares Capital Corporation is a business development company specializing in acquisition, recapitalization, mezzanine debt, restructurings, rescue financing, and leveraged buyout transactions of middle market companies. It also makes growth capital and general refinancing. It prefers to make investments in companies engaged in the basic and growth manufacturing, business services, consumer products, health care products and services, and information technology service sectors. The fund will also consider investments in industries such as restaurants, retail, oil and gas, and technology sectors. It focuses on investments in Northeast, Mid-Atlantic, Southeast and Southwest regions from its New York office, the Midwest region, from the Chicago office, and the Western region from the Los Angeles office. The fund typically invests between $20 million and $200 million and a maximum of $400 million in companies with an EBITDA between $10 million and $250 million. It makes debt investments between $10 million and $100 million The fund invests through revolvers, first lien loans, warrants, unitranche structures, second lien loans, mezzanine debt, private high yield, junior capital, subordinated debt, and non-control preferred and common equity. The fund also selectively considers third-party-led senior and subordinated debt financings and opportunistically considers the purchase of stressed and discounted debt positions. The fund prefers to be an agent and/or lead the transactions in which it invests. The fund also seeks board representation in its portfolio companies.","Darden Restaurants, Inc., through its subsidiaries, owns and operates full-service restaurants in the United States and Canada. As of May 29, 2022, it owned and operated 1,867 restaurants, which included 884 under the Olive Garden brand, 546 under the LongHorn Steakhouse brand name, 172 under the Cheddar's Scratch Kitchen brand, 85 under the Yard House brand name, 62 under The Capital Grille brand, 45 under the Seasons 52 brand name, 42 under the Bahama Breeze brand, 28 under the Eddie V's Prime Seafood brand name, and 3 under the Capital Burger brand; and franchised 60 restaurants comprising 35 under the Olive Garden brand, 18 under the LongHorn Steakhouse brand name, 4 under the Cheddar's Scratch Kitchen brand, 2 under The Capital Grille brand name, and 1 under the Bahama Breeze brand.Darden Restaurants, Inc. was founded in 1968 and is based in Orlando, Florida.","First Community Bankshares, Inc. operates as the financial holding company for First Community Bank that provides various banking products and services. It offers demand deposit accounts, savings and money market accounts, certificates of deposit, and individual retirement arrangements; commercial, consumer, and real estate mortgage loans, as well as lines of credit; various credit and debit cards, and automated teller machine card services; and corporate and personal trust services. The company also provides wealth management services, including trust management, estate administration, and investment advisory services; and investment management services. It serves individuals and businesses across various industries, such as education, government, and health services; coal mining and gas extraction; retail trade; construction; manufacturing; tourism; and transportation. As of December 31, 2021, the company operated 49 branches, including 17 branches in West Virginia, 23 branches in Virginia, 7 branches in North Carolina, and 2 branches in Tennessee. First Community Bankshares, Inc. was founded in 1874 and is headquartered in Bluefield, Virginia.","ExlService Holdings, Inc. operates as a data analytics, and digital operations and solutions company in the United States and internationally. It operates through Insurance, Healthcare, Analytics, and Emerging Business segments. The company provides digital operations and solutions and analytics-driven services across the insurance industry in areas, such as claims processing, premium and benefit administration, agency management, account reconciliation, policy research, underwriting support, new business acquisition, policy servicing, premium audit, surveys, billing and collection, commercial and residential survey, and customer service using digital technology, artificial intelligence, machine learning, and advanced automation; digital customer acquisition services using a software-as-a-service delivery model through LifePRO and LISS platforms; subrogation services; and Subrosource software platform, an end-to-end subrogation platform. It also offers CareRadius, an integrated care management offering; and health care services related to care management, utilization management, disease management, payment integrity, revenue optimization and customer engagement to healthcare payers, providers, pharmacy benefit managers, and life sciences organizations. Further, it offers predictive and prescriptive analytics in the areas of customer acquisition and lifecycle management, risk underwriting and pricing, operational effectiveness, credit and operational risk monitoring and governance, payment integrity and care management, and data management. The company was founded in 1999 and is headquartered in New York, New York.","Microchip Technology Incorporated develops, manufactures, and sells smart, connected, and secure embedded control solutions in the Americas, Europe, and Asia. The company offers general purpose 8-bit, 16-bit, and 32-bit microcontrollers; 32-bit embedded microprocessors markets; and specialized microcontrollers for automotive, industrial, computing, communications, lighting, power supplies, motor control, human machine interface, security, wired connectivity, and wireless connectivity applications. It also provides development tools that enable system designers to program microcontroller and microprocessor products for specific applications; field-programmable gate array (FPGA) products; and analog, interface, mixed signal, and timing products comprising power management, linear, mixed-signal, high-voltage, thermal management, discrete diodes and metal oxide semiconductor field effect transistors (MOSFETS), radio frequency (RF), drivers, safety, security, timing, USB, Ethernet, wireless, and other interface products. In addition, the company offers memory products consisting of serial electrically erasable programmable read-only memory, serial flash memories, parallel flash memories, serial static random access memories, and serial electrically erasable random access memories for the production of very small footprint devices; and licenses its SuperFlash embedded flash and NVM technologies to foundries, integrated device manufacturers, and design partners for use in the manufacture of microcontroller products, gate array, RF, analog, and neuromorphic compute products that require embedded non-volatile memory, as well as provides engineering services. Further, it offers wafer foundry and assembly, and test subcontracting manufacturing services; and timing systems products, application specific integrated circuits, and aerospace products. Microchip Technology Incorporated was incorporated in 1989 and is headquartered in Chandler, Arizona.","Hewlett Packard Enterprise Company provides solutions that allow customers to capture, analyze, and act upon data seamlessly in the Americas, Europe, the Middle East, Africa, the Asia Pacific, and Japan. The company offers general purpose servers for multi-workload computing and workload-optimized servers; HPE ProLiant rack and tower servers; HPE BladeSystem and HPE Synergy; and solutions for secondary workloads and traditional tape, storage networking, and disk products, such as HPE Modular Storage Arrays and HPE XP. It also offers HPE Apollo and Cray products; and HPE Superdome Flex, HPE Nonstop, HPE Integrity, and HPE Edgeline products. In addition, the company provides HPE Aruba product portfolio that includes wired and wireless local area network hardware products, such as Wi-Fi access points, switches, routers, and sensors; HPE Aruba software and services comprising cloud-based management, network management, network access control, analytics and assurance, and location; and professional and support services, as well as as-a-service and consumption models for the intelligent edge portfolio of products. Further, it offers various leasing, financing, IT consumption, and utility programs and asset management services for customers to facilitate technology deployment models and the acquisition of complete IT solutions, including hardware, software, and services from Hewlett Packard Enterprise and others. Additionally, the company invests in communications and media solutions. It has a partnership with Striim, Inc. to offer high performance and mission-critical solutions with real-time analytics. It serves commercial and large enterprise groups, such as business and public sector enterprises; and through various partners comprising resellers, distribution partners, original equipment manufacturers, independent software vendors, systems integrators, and advisory firms. Hewlett Packard Enterprise Company was founded in 1939 and is headquartered in Houston, Texas.","Marsh &amp; McLennan Companies, Inc., a professional services company, provides advice and solutions to clients in the areas of risk, strategy, and people worldwide. It operates in two segments, Risk and Insurance Services, and Consulting. The Risk and Insurance Services segment offers risk management services, such as risk advice, risk transfer, and risk control and mitigation solutions, as well as insurance and reinsurance broking, catastrophe and financial modeling, and related advisory services; and insurance program management services. This segment serves businesses, public entities, insurance companies, associations, professional services organizations, and private clients. The Consulting segment provides health, wealth, and career consulting services and products; and specialized management, as well as economic and brand consulting services. Marsh &amp; McLennan Companies, Inc. was founded in 1871 and is headquartered in New York, New York.","Analog Devices, Inc. designs, manufactures, tests, and markets integrated circuits (ICs), software, and subsystems that leverage analog, mixed-signal, and digital signal processing technologies. The company provides data converter products, which translate real-world analog signals into digital data, as well as translates digital data into analog signals; power management and reference products for power conversion, driver monitoring, sequencing, and energy management applications in the automotive, communications, industrial, and high-end consumer markets; and power ICs include performance, integration, and software design simulation tools for accurate power supply designs. It also offers high-performance amplifiers to condition analog signals; and radio frequency and microwave ICs to support cellular infrastructure; and microelectromechanical systems technology solutions, including accelerometers used to sense acceleration, gyroscopes for sense rotation, inertial measurement units to sense multiple degrees of freedom, and broadband switches for radio and instrument systems, as well as isolators. In addition, the company offers digital signal processing and system products for high-speed numeric calculations. It serves clients in the industrial, automotive, consumer, instrumentation, aerospace, and communications markets through a direct sales force, third-party distributors, and independent sales representatives in the United States, the rest of North and South America, Europe, Japan, China, and rest of Asia, as well as through its Website. Analog Devices, Inc. was incorporated in 1965 and is headquartered in Wilmington, Massachusetts.","Bloomin' Brands, Inc., through its subsidiaries, owns and operates casual, upscale casual, and fine dining restaurants in the United States and internationally. The company operates through two segments, U.S. and International. Its restaurant portfolio has four concepts, including Outback Steakhouse, a casual steakhouse restaurant; Carrabba's Italian Grill, a casual Italian restaurant; Bonefish Grill; and Fleming's Prime Steakhouse &amp; Wine Bar, a contemporary steakhouse. As of December 26, 2021, the company owned and operated 1,013 full-service restaurants and franchised 157 restaurants across 47 states; and 156 full-service restaurants and franchised 172 restaurants across 17 countries and Guam. The company was founded in 1988 and is based in Tampa, Florida.","Keysight Technologies, Inc. provides electronic design and test solutions to commercial communications, networking, aerospace, defense and government, automotive, energy, semiconductor, electronic, and education industries in the Americas, Europe, and the Asia Pacific. Its Communications Solutions Group segment provides electronic design automation (EDA) software; radio frequency and microwave test solutions, and related software; hardware and virtual network test platforms and software applications, including data center, routing and switching, software defined networking, security, and encryption; oscilloscopes, logic and serial protocol analyzers, logic-signal sources, arbitrary waveform generators, and bit error rate testers; and optical modulation analyzers, optical component analyzers, optical power meters, and optical laser source solutions, as well as resells refurbished used Keysight equipment. The company's Electronic Industrial Solutions Group segment offers design tools; design verification tools; and digital multimeters, function generators, frequency counters, data acquisition systems, audio analyzers, LCR meters, thermal imagers, source measure units, ultra-high precision device current analyzers, and test executive software platforms, as well as various power supplies comprising AC/DC modular supplies and electronically programmable loads. This segment also provides printed-circuit-board-assembly testers, integrated circuit parametric testers, and sub-nano-meter positioning sub-assemblies; and test and measurement products and software. The company offers product support, technical support, and training and consulting services. It sells its products through direct sales force, distributors, resellers, and manufacturer's representatives. Keysight Technologies, Inc. was founded in 1939 and is headquartered in Santa Rosa, California.","Invesco Ltd. is a publicly owned investment manager. The firm provides its services to retail clients, institutional clients, high-net worth clients, public entities, corporations, unions, non-profit organizations, endowments, foundations, pension funds, financial institutions, and sovereign wealth funds. It manages separate client-focused equity and fixed income portfolios. The firm also launches equity, fixed income, commodity, multi-asset, and balanced mutual funds for its clients. It launches equity, fixed income, multi-asset, and balanced exchange-traded funds. The firm also launches and manages private funds. It invests in the public equity and fixed income markets across the globe. The firm also invests in alternative markets, such as commodities and currencies. For the equity portion of its portfolio, it invests in growth and value stocks of large-cap, mid-cap, and small-cap companies. For the fixed income portion of its portfolio, the firm invests in convertibles, government bonds, municipal bonds, treasury securities, and cash. It also invests in short term and intermediate term bonds, investment grade and high yield bonds, taxable and tax-free bonds, senior secured loans, and structured securities such as asset-backed securities, mortgage-backed securities, and commercial mortgage-backed securities. The firm employs absolute return, global macro, and long/short strategies. It employs quantitative analysis to make its investments. The firm was formerly known as Invesco Plc, AMVESCAP plc, Amvesco plc, Invesco PLC, Invesco MIM, and H. Lotery &amp; Co. Ltd. Invesco Ltd. was founded in December 1935 and is based in Atlanta, Georgia with an additional office in Hamilton, Bermuda.","ECB Bancorp, Inc. focuses on operating as a holding company for Everett Co-operative Bank that provides various banking products and services. The company accepts various deposit products, including certificate of deposit accounts, IRAs, money market accounts, savings accounts, demand deposit accounts, and interest-bearing and noninterest-bearing checking accounts. It also offers one- to four-family residential real estate, commercial real estate and multifamily real estate, construction and land, commercial, and consumer loans, as well as home equity loans and lines of credit. In addition, the company invests in securities, consisting primarily of U.S. government and federal agency obligations, mortgage-backed securities, and corporate bonds. It operates through two full-service banking offices located in Everett, Massachusetts and Lynnfield, Massachusetts. The company was founded in 1890 and is based in Everett, Massachusetts.","The Procter &amp; Gamble Company provides branded consumer packaged goods worldwide. It operates through five segments: Beauty; Grooming; Health Care; Fabric &amp; Home Care; and Baby, Feminine &amp; Family Care. The Beauty segment offers conditioners, shampoos, styling aids, and treatments under the Head &amp; Shoulders, Herbal Essences, Pantene, and Rejoice brands; and antiperspirants and deodorants, personal cleansing, and skin care products under the Olay, Old Spice, Safeguard, Secret, and SK-II brands. The Grooming segment provides shave care products and appliances under the Braun, Gillette, and Venus brand names. The Health Care segment offers toothbrushes, toothpastes, and other oral care products under the Crest and Oral-B brand names; and gastrointestinal, rapid diagnostics, respiratory, vitamins/minerals/supplements, pain relief, and other personal health care products under the Metamucil, Neurobion, Pepto-Bismol, and Vicks brands. The Fabric &amp; Home Care segment provides fabric enhancers, laundry additives, and laundry detergents under the Ariel, Downy, Gain, and Tide brands; and air care, dish care, P&amp;G professional, and surface care products under the Cascade, Dawn, Fairy, Febreze, Mr. Clean, and Swiffer brands. The Baby, Feminine &amp; Family Care segment offers baby wipes, taped diapers, and pants under the Luvs and Pampers brands; adult incontinence and feminine care products under the Always, Always Discreet, and Tampax brands; and paper towels, tissues, and toilet papers under the Bounty, Charmin, and Puffs brands. The company sells its products primarily through mass merchandisers, e-commerce, grocery stores, membership club stores, drug stores, department stores, distributors, wholesalers, specialty beauty stores, high-frequency stores, pharmacies, electronics stores, and professional channels, as well as directly to consumers. The Procter &amp; Gamble Company was founded in 1837 and is headquartered in Cincinnati, Ohio.","First Business Financial Services, Inc. operates as the bank holding company for First Business Bank that provides commercial banking products and services for small and medium-sized businesses, business owners, executives, professionals, and high net worth individuals. The company offers deposit products, such as non-interest-bearing transaction accounts, interest-bearing transaction accounts, money market accounts, time deposits, and certificates of deposit, as well as credit cards. It also provides loan products, including commercial real estate loans, commercial and industrial loans, small business administration loans, and direct financing leases, as well as consumer and other loans comprising home equity, first and second mortgage, and other personal loans for professional and executive clients. The company offers commercial lending, asset-based lending, equipment financing, accounts receivable financing, vendor financing, floorplan financing, treasury management services, and company retirement plans; trust and estate administration, financial planning, investment management, and private banking services; and investment portfolio administrative, asset-liability management, and asset-liability management process validation services for other financial institutions. First Business Financial Services, Inc. was founded in 1909 and is headquartered in Madison, Wisconsin.","Codorus Valley Bancorp, Inc. operates as the bank holding company for the PeoplesBank that provides community banking services. The company accepts demand, money market, time, and savings deposits, as well as certificates of deposit. It also offers commercial loans, such as builder and developer, commercial and residential real estate investor, hotel/motel, wholesale and retail, agriculture, manufacturing, and other loans; consume loans, including residential mortgage, home equity, and others. In addition, the company provides mortgage and wealth management services; and sells non-deposit investment products. It operates through twenty-five full service financial centers located in South Central Pennsylvania and Central Maryland. The company was founded in 1864 and is headquartered in York, Pennsylvania.","Columbia Sportswear Company, together with its subsidiaries, designs, sources, markets, and distributes outdoor, active, and everyday lifestyle apparel, footwear, accessories, and equipment in the United States, Latin America, the Asia Pacific, Europe, the Middle East, Africa, and Canada. The company provides apparel, accessories, and equipment that are used in various activities, such as skiing, snowboarding, hiking, climbing, mountaineering, camping, hunting, fishing, trail running, water sports, yoga, golf, and adventure travel. It also offers footwear products that include lightweight hiking boots, trail running shoes, rugged cold weather boots for activities on snow and ice, sandals and shoes for use in water activities, and function-first fashion footwear and casual shoes for everyday use. The company sells its products under the Columbia, Mountain Hardwear, SOREL, and prAna brand names through the company owned network of branded and outlet retail stores, brand-specific e-commerce sites, and concession-based arrangements with third-parties at branded outlet and shop-in-shop retail locations, as well as through independently operated specialty outdoor and sporting goods stores, sporting goods chains, department store chains, Internet retailers, and international distributors. As of December 31, 2021, it operated approximately 455 retail stores. The company was founded in 1938 and is headquartered in Portland, Oregon.","ESSA Bancorp, Inc. operates as a bank holding company for ESSA Bank &amp; Trust that provides a range of financial services to individuals, families, and businesses in Pennsylvania. The company accepts savings accounts, interest bearing demand accounts, checking accounts, money market accounts, club accounts, certificates of deposit and IRAs, and other qualified plan accounts, as well as commercial checking accounts. Its loan portfolio includes first mortgage loans for the purchase, construction, or refinancing of one- to four-family residential real estate property; commercial real estate loans; home equity loans and lines of credit; and commercial and other consumer loans, as well as loans secured by deposits and personal unsecured loans. In addition, the company offers insurance benefits consulting services, such as health insurance, life insurance, short term and long term disability, dental, vision, 401(K) retirement planning, and individual health products, as well as asset management and trust, and investment services. As of September 30, 2021, it operated 21 community offices, including seven offices in Monroe County, three offices in Lehigh County, five offices in Northampton County, one office in Lackawanna County, one office in Luzerne County, one office in Chester County, two offices in Delaware County, and one office in Montgomery County, Pennsylvania. The company was founded in 1916 and is headquartered in Stroudsburg, Pennsylvania.","Texas Instruments Incorporated designs, manufactures, and sells semiconductors to electronics designers and manufacturers worldwide. It operates in two segments, Analog and Embedded Processing. The Analog segment offers power products to manage power requirements in various levels using battery-management solutions, DC/DC switching regulators, AC/DC and isolated controllers and converters, power switches, linear regulators, voltage supervisors, voltage references, and lighting products. This segment also provides signal chain products that sense, condition, and measure signals to allow information to be transferred or converted for further processing and control for use in end markets, including amplifiers, data converters, interface products, motor drives, clocks, and sensing products. The Embedded Processing segment offers microcontrollers that are used in electronic equipment; digital signal processors for mathematical computations; and applications processors for specific computing activity. This segment offers products for use in various markets, such as industrial, automotive, personal electronics, communications equipment, enterprise systems, and calculators and other. The company also provides DLP products primarily for use in projectors to create high-definition images; calculators; and application-specific integrated circuits. It markets and sells its semiconductor products through direct sales and distributors, as well as through its website. Texas Instruments Incorporated was founded in 1930 and is headquartered in Dallas, Texas.","Chesapeake Energy Corporation, an independent exploration and production company, engages in the acquisition, exploration, and development of properties for the production of oil, natural gas, and natural gas liquids from underground reservoirs in the United States. The company holds interests in natural gas resource plays in the Marcellus Shale in the northern Appalachian Basin in Pennsylvania and the Haynesville/Bossier Shales in northwestern Louisiana; and the liquids-rich resource play in the Eagle Ford Shale in South Texas. As of December 31, 2021, it owned interests in approximately 8,200 gross productive wells, including 6,500 wells with working interest and 1,700 wells with an overriding or royalty interest; and had estimated proved reserves of 661 million barrels of oil equivalent. The company was founded in 1989 and is headquartered in Oklahoma City, Oklahoma.","McCormick &amp; Company, Incorporated manufactures, markets, and distributes spices, seasoning mixes, condiments, and other flavorful products to the food industry. It operates in two segments, Consumer and Flavor Solutions. The Consumer segment offers spices, herbs, and seasonings, as well as condiments and sauces, and desserts. This segment markets its products under the McCormick, French's, Frank's RedHot, Lawry's Cholula Hot Sauce, Gourmet Garden, Club House, and OLD BAY brands in the Americas; Ducros, Schwartz, Kamis, and Drogheria &amp; Alimentari, and Vahin\u00e9 brands in Europe, the Middle East, and Africa; McCormick and DaQiao brands in China; and McCormick, Aeroplane, and Gourmet Garden brands in Australia, as well as markets regional and ethnic brands, such as Zatarain's, Stubb's, Thai Kitchen, and Simply Asia. It also supplies its products under the private labels. This segment serves retailers comprising grocery, mass merchandise, warehouse clubs, discount and drug stores, and e-commerce retailers directly and indirectly through distributors and wholesale foodservice suppliers. The Flavor Solutions segment offers seasoning blends, spices and herbs, condiments, coating systems, and compound flavors to multinational food manufacturers and foodservice customers. It serves foodservice customers directly and indirectly through distributors. The company was founded in 1889 and is headquartered in Hunt Valley, Maryland.","Community Trust Bancorp, Inc. operates as the bank holding company for Community Trust Bank, Inc. that provides commercial and personal banking services to small and mid-sized communities. The company accepts time and demand deposits, checking accounts, savings accounts and savings certificates, individual retirement accounts and Keogh plans, and money market accounts. Its loan products include commercial, construction, mortgage, and personal loans; lease-financing, lines of credit, revolving lines of credit, and term loans, as well as other specialized loans, including asset-based financing; residential and commercial real estate loans; and consumer loans. The company also provides cash management, renting safe deposit boxes, and funds transfer services; issues letters of credit; and acts as a trustee of personal trusts, executor of estates, trustee for employee benefit trusts, and paying agent for bond and stock issues, as well as an investment agent and depositor for securities. In addition, it offers securities brokerage, and trust and wealth management services; debit cards; annuity and life insurance products; and repurchase agreements, as well as mobile, internet banking, and e-statement services. The company operates 79 banking locations in eastern, northeastern, central, south central Kentucky, southern West Virginia, and northeastern Tennessee; 4 trust offices across Kentucky; and 1 trust office in northeastern Tennessee. Community Trust Bancorp, Inc. was founded in 1903 and is headquartered in Pikeville, Kentucky.","Eastern Bankshares, Inc. operates as the bank holding company for Eastern Bank that provides banking products and services primarily to retail, commercial, and small business customers. It operates in two segments, Banking Business and Insurance Agency Business. The company provides interest-bearing and non interest-bearing checking deposits, money market deposits, savings deposits, and time certificates of deposits, as well as debit and credit cards. It also offers commercial and industrial loans, commercial real estate and construction loans, small business loans, residential real estate loans, home equity, and lines of credit, as well as other consumer loans comprising unsecured personal lines of credit, overdraft protection, automobile loans, home improvement loans, airplane loans, and other personal loans. In addition, the company provides cash reserves, cash management, merchant, escrow express, government banking, international banking, interest on lawyers trust accounts, retirement planning, and business telephone banking services, as well as products and services for not-for-profit and healthcare. Further, it offers trust and investment products and services; community development and asset-based lending services; financial planning, portfolio management, wealth management, private banking, and fiduciary products; online, mobile, and telephone banking services; and automated lock box collection and account reconciliation services, as well as various insurance products. As of December 31, 2021, the company operated 105 branch offices in eastern Massachusetts and southern New Hampshire; and 23 non-branch offices in eastern Massachusetts, one office in New Hampshire, and one office in Rhode Island. Eastern Bankshares, Inc. was founded in 1818 and is headquartered in Boston, Massachusetts.",null,"3M Company operates as a diversified technology company worldwide. It operates through four segments: Safety and Industrial; Transportation and Electronics; Health Care; and Consumer. The Safety and Industrial segment offers industrial abrasives and finishing for metalworking applications; autobody repair solutions; closure systems for personal hygiene products, masking, and packaging materials; electrical products and materials for construction and maintenance, power distribution, and electrical original equipment manufacturers; structural adhesives and tapes; respiratory, hearing, eye, and fall protection solutions; and natural and color-coated mineral granules for shingles. The Transportation and Electronics segment provides ceramic solutions; attachment tapes, films, sound, and temperature management for transportation vehicles; premium large format graphic films for advertising and fleet signage; light management films and electronics assembly solutions; packaging and interconnection solutions; and reflective signage for highway, and vehicle safety. The Healthcare segment offers food safety indicator solutions; health care procedure coding and reimbursement software; skin, wound care, and infection prevention products and solutions; dentistry and orthodontia solutions; and filtration and purification systems. The Consumer segment provides consumer bandages, braces, supports and consumer respirators; cleaning products for the home; retail abrasives, paint accessories, car care DIY products, picture hanging, and consumer air quality solutions; and stationery products. It offers its products through e-commerce and traditional wholesalers, retailers, jobbers, distributors, and dealers. The company was founded in 1902 and is based in St. Paul, Minnesota.","Destination XL Group, Inc., together with its subsidiaries, operates as a specialty retailer of big and tall men's clothing and shoes in the United States and Canada. Its stores offer sportswear and dresswear; fashion-neutral items, including jeans, casual slacks, T-shirts, polo shirts, dress shirts, and suit separates; and casual clothing. It also provides tailored-related separates, blazers, dress slacks, dress shirts, and neckwear; and vintage-screen T-shirts and wovens under various private labels. The company offers its products under the trade names of Destination XL, DXL, DXL Men's Apparel, DXL outlets, Casual Male XL, and Casual Male XL outlets. As of January 29, 2022, it operated 220 DXL retail stores, 16 DXL outlet stores, 35 Casual Male XL retail stores, and 19 Casual Male XL outlet stores; an e-commerce site, dxl.com; a mobile site, m.destinationXL.com; and mobile app. The company was formerly known as Casual Male Retail Group, Inc. and changed its name to Destination XL Group, Inc. in February 2013. Destination XL Group, Inc. was incorporated in 1976 and is headquartered in Canton, Massachusetts.","Celsius Holdings, Inc. develops, processes, markets, distributes, and sells functional drinks and liquid supplements in North America, Europe, Asia, and internationally. It offers various carbonated and non-carbonated functional energy drinks under the CELSIUS Originals name; dietary supplement in carbonated flavors, including apple jack'd, orangesicle, inferno punch, cherry lime, blueberry pomegranate, strawberry dragon fruit, tangerine grapefruit, and jackfruit under the CELSIUS HEAT name; and branched-chain amino acids functional energy drink that fuels muscle recovery under the CELSIUS BCCA+ENERGY name. The company also provides CELSIUS On-the-Go, a powdered form of the active ingredients in functional energy drinks in individual On-The-Go packets and canisters; and sparkling grapefruit, cucumber lime, and orange pomegranate, as well as pineapple coconut, watermelon berry, and strawberries and cream non-carbonated functional energy drinks under the CELSIUS Sweetened. It distributes its products through direct-to-store delivery distributors and direct to retailers, including supermarkets, convenience stores, drug stores, nutritional stores, and mass merchants, as well as health clubs, spas, gyms, the military, and e-commerce websites. The company was formerly known as Vector Ventures, Inc. and changed its name to Celsius Holdings, Inc. in January 2007. Celsius Holdings, Inc. was founded in 2004 and is headquartered in Boca Raton, Florida.","Akso Health Group operates a social e-commerce mobile platform in China. The company operates Xiaobai Maimai App, which offers food and beverage products, wine, cosmetic products, fashion and apparel, entertainment products, housewares, home appliances, etc. It also offers consultancy and information technology support services; and trades in branded products, as well as promotes products. The company was formerly known as Xiaobai Maimai Inc. and changed its name to Akso Health Group in December 2021. Akso Health Group was founded in 2014 and is headquartered in Beijing, China. As of July 13, 2021, Akso Health Group operates as a subsidiary of Webao Limited.","Tesla, Inc. designs, develops, manufactures, leases, and sells electric vehicles, and energy generation and storage systems in the United States, China, and internationally. It operates in two segments, Automotive, and Energy Generation and Storage. The Automotive segment offers electric vehicles, as well as sells automotive regulatory credits; and non-warranty after-sales vehicle, used vehicles, retail merchandise, and vehicle insurance services. This segment also provides sedans and sport utility vehicles through direct and used vehicle sales, a network of Tesla Superchargers, and in-app upgrades; purchase financing and leasing services; services for electric vehicles through its company-owned service locations and Tesla mobile service technicians; and vehicle limited warranties and extended service plans. The Energy Generation and Storage segment engages in the design, manufacture, installation, sale, and leasing of solar energy generation and energy storage products, and related services to residential, commercial, and industrial customers and utilities through its website, stores, and galleries, as well as through a network of channel partners; and provision of service and repairs to its energy product customers, including under warranty, as well as various financing options to its solar customers. The company was formerly known as Tesla Motors, Inc. and changed its name to Tesla, Inc. in February 2017. Tesla, Inc. was incorporated in 2003 and is headquartered in Austin, Texas.","A-Mark Precious Metals, Inc., together with its subsidiaries, operates as a precious metals trading company. It operates in three segments: Wholesale Sales &amp; Ancillary Services, Direct-to-Consumer, and Secured Lending. The Wholesale Sales &amp; Ancillary Services segment sells gold, silver, platinum, and palladium in the form of bars, plates, powders, wafers, grains, ingots, and coins. This segment also offers various ancillary services, including financing, storage, consignment, logistics, and various customized financial programs; and designs and produces minted silver products. The Direct-to-Consumer segment provides access to an array of gold, silver, copper, platinum, and palladium products through its websites and marketplaces. It operates five company-owned websites targeting specific niches within the precious metals retail market. This segment also operates as a direct retailer of precious metals to the investor community and markets its precious metal products on television, radio, and the internet, as well as through customer service outreach. The Secured Lending segment originates and acquires commercial loans secured by bullion and numismatic coins; and serves coin and precious metal dealers, investors, and collectors. The company serves customers, including financial institutions, bullion retailers, industrial manufacturers and fabricators, sovereign mints, refiners, coin and metal dealers, investors, collectors, and e-commerce and other retail customers. It has operations in the United States, rest of North America, Europe, the Asia Pacific, Africa, and Australia. A-Mark Precious Metals, Inc. was founded in 1965 and is headquartered in El Segundo, California.","Aehr Test Systems provides test systems for burning-in and testing logic, optical, and memory integrated circuits worldwide. It offers products, such as the ABTS and FOX-P families of test and burn-in systems and FOX WaferPak Aligner, FOX-XP WaferPak Contactor, FOX DiePak Carrier, and FOX DiePak Loader. The ABTS system is used in production and qualification testing of packaged parts for lower power and higher power logic devices, as well as various common types of memory devices. The FOX-XP and FOX-NP systems are wafer contact and singulated die/module test and burn-in systems used for burn-in and functional test of complex devices, such as memories, digital signal processors, microprocessors, microcontrollers, systems-on-a-chip, and integrated optical devices. The FOX-CP system is a single-wafer compact test and reliability verification solution for logic, memory, and photonic devices. The WaferPak Contactor contains a unique full wafer probe card capable of testing wafers up to 300mm that enables IC manufacturers to perform test and burn-in of full wafers on Aehr Test FOX systems. The DiePak Carrier is a reusable, temporary package that enables IC manufacturers to perform final test and burn-in of bare die and modules. Aehr Test Systems was incorporated in 1977 and is headquartered in Fremont, California.","Extreme Networks, Inc. provides software-driven networking solutions worldwide. It designs, develops, and manufactures wired and wireless network infrastructure equipment; and develops software for network management, policy, analytics, security, and access controls. The company offers ExtremeCloud IQ, an ML/AI powered, wired, and wireless cloud network management solution that offers advanced visibility and control over users, devices, and applications; ExtremeCloud IQ \u0096 Site Engine that provides task automation, access control, granular visibility with real-time analytics and multi-vendor device management; and ExtremeCloud IQ Essentials offers WIPS, location services, IoT, and guest management services. It also provides wireless access point products; ExtremeSwitching portfolio that includes access edge products that offer physical presentations along with options to deliver Ethernet or convergence-friendly Power-over-Ethernet (POE), including high-power universal POE; aggregation/core switches designed to address aggregation, top-of-rack, and campus core environments; and data center switches and routers. In addition, the company offers cloud native platforms and applications for service providers; and customer support and services. It markets and sells its products through distributors, resellers, and field sales organizations to healthcare, education, government, manufacturing, retail, and hospitality markets. Extreme Networks, Inc. was incorporated in 1996 and is headquartered in Morrisville, North Carolina.","Alliance Resource Partners, L.P., a diversified natural resource company, produces and markets coal primarily to utilities and industrial users in the United States. The company operates through four segments: Illinois Basin Coal Operations, Appalachia Coal Operations, Oil &amp; Gas Royalties, and Coal Royalties. It produces a range of thermal and metallurgical coal with sulfur and heat contents. The company operates seven underground mining complexes in Illinois, Indiana, Kentucky, Maryland, Pennsylvania, and West Virginia. In addition, it leases land and operates a coal loading terminal on the Ohio River at Mt. Vernon, Indiana; and buys and resells coal, as well as owns mineral and royalty interests in approximately 1.5 million gross acres of oil and gas producing regions primarily in the Permian, Anadarko, and Williston Basins. Further, the company offers various mining technology products and services, including data network, communication and tracking systems, mining proximity detection systems, industrial collision avoidance systems, and data and analytics software. As of December 31, 2021, it had approximately 547.1 million tons of proven and probable coal mineral reserves, as well as 1.17 billion tons of measured, indicated, and inferred coal mineral resources in Illinois, Indiana, Kentucky, Maryland, Pennsylvania, and West Virginia. The company was founded in 1971 and is headquartered in Tulsa, Oklahoma.","The Vita Coco Company, Inc. develops, markets, and distributes coconut water products under the Vita Coco brand name in the United States, Canada, Europe, the Middle East, and the Asia Pacific. The company offers coconut oil and coconut milk; Hydration Drink Mix, a powdered form of flavored coconut water; sparkling water; Runa, a plant-based energy drink; purified water under the Ever &amp; Ever brand name; and PWR LIFT, a protein-infused fitness drink. It distributes its products through club, food, drug, mass, convenience, e-commerce, and foodservice channels. In addition, the company supplies coconut water and coconut oil categories to retailers. The company was formerly known as All Market Inc. and changed its name to The Vita Coco Company, Inc. in September 2021.The Vita Coco Company, Inc. was founded in 2004 and is headquartered in New York, New York.","Avis Budget Group, Inc., together with its subsidiaries, provides car and truck rentals, car sharing, and ancillary products and services to businesses and consumers. It operates the Avis brand, that offers vehicle rental and other mobility solutions to the premium commercial and leisure segments of the travel industry; the Budget Truck brand, a local, and one-way truck and cargo van rental businesses with a fleet of approximately 20,000 vehicles, which are rented through a network of approximately 465 dealer-operated and 385 company-operated locations that serve the consumer and light commercial sectors in the continental United States; and the Zipcar brand, a car sharing network. The company also operates various other car rental brands, such as Budget, Payless, Apex, Maggiore, MoriniRent, FranceCars, Amicoblue, Turiscar, and ACL Hire. In addition, it offers optional insurance products and coverages, such as supplemental liability, personal accident, personal effects protection, emergency sickness protection, and automobile towing protection and cargo insurance products; fuel service options, roadside assistance services, electronic toll collection services, curbside delivery, tablet rentals, access to satellite radio, portable navigation units, and child safety seat rentals; automobile towing equipment and other moving accessories, such as hand trucks, furniture pads, and moving supplies; and Business Intelligence solution, an online portal for corporate travel. Avis Budget Group, Inc. operates in approximately 10,400 locations worldwide. The company was formerly known as Cendant Corporation and changed its name to Avis Budget Group, Inc. in September 2006. Avis Budget Group, Inc. was founded in 1946 and is headquartered in Parsippany, New Jersey.","Apple Inc. designs, manufactures, and markets smartphones, personal computers, tablets, wearables, and accessories worldwide. The company offers iPhone, a line of smartphones; Mac, a line of personal computers; iPad, a line of multi-purpose tablets; and wearables, home, and accessories comprising AirPods, Apple TV, Apple Watch, Beats products, and HomePod. It also provides AppleCare support and cloud services; and operates various platforms, including the App Store that allow customers to discover and download applications and digital content, such as books, music, video, games, and podcasts. In addition, the company offers various services, such as Apple Arcade, a game subscription service; Apple Fitness+, a personalized fitness service; Apple Music, which offers users a curated listening experience with on-demand radio stations; Apple News+, a subscription news and magazine service; Apple TV+, which offers exclusive original content; Apple Card, a co-branded credit card; and Apple Pay, a cashless payment service, as well as licenses its intellectual property. The company serves consumers, and small and mid-sized businesses; and the education, enterprise, and government markets. It distributes third-party applications for its products through the App Store. The company also sells its products through its retail and online stores, and direct sales force; and third-party cellular network carriers, wholesalers, retailers, and resellers. Apple Inc. was incorporated in 1977 and is headquartered in Cupertino, California.","Cross Country Healthcare, Inc. provides talent management and other consultative services for healthcare clients in the United States. The company operates in two segments, Nurse and Allied Staffing and Physician Staffing. The Nurse and Allied Staffing segment offers traditional staffing, including temporary and permanent placement of travel nurses and allied professionals, local nurses, and allied staffing; staffing solutions for registered nurses, licensed practical nurses, certified nurse assistants, practitioners, pharmacists, and other allied professionals on per diem and short-term assignments; and clinical and non-clinical professionals on long-term contract assignments, as well as workforce solutions, including MSP, RPO, and consulting services. It also provides retained search services for healthcare professionals, as well as contingent search and recruitment process outsourcing services. This segment serves public and private acute care and non-acute care hospitals, government facilities, local and national healthcare plans, managed care providers, public and charter schools, outpatient clinics, ambulatory care facilities, physician practice groups, and other healthcare providers under the Cross Country brand. The Physician Staffing segment provides physicians in various specialties, certified registered nurse anesthetists, nurse practitioners, and physician assistants under the Cross Country Locums brand as independent contractors on temporary assignments at various healthcare facilities, such as acute and non-acute care facilities, medical group practices, government facilities, and managed care organizations. The company was founded in 1986 and is headquartered in Boca Raton, Florida.","Five Below, Inc. operates as a specialty value retailer in the United States. It offers accessories, including socks, sunglasses, jewelry, scarves, gloves, hair accessories, athletic tops and bottoms, and t-shirts, as well as nail polishes, lip glosses, fragrances, and branded cosmetics; and items used to complete and personalize living space, such as glitter lamps, posters, frames, fleece blankets, plush items, pillows, candles, incense, lighting, novelty d\u00e9cor, accent furniture, and related items, as well as provides storage options for the customers room. The company also provides sport balls; team sports merchandise and fitness accessories, such as hand weights, jump ropes, and gym balls; games, including name brand board games, puzzles, collectibles, and toys covering remote control; and pool, beach, and outdoor toys, as well as games and accessories. In addition, it offers accessories for cell phones, tablets, audio, and computers, such as cases, chargers, headphones, and other items; books, video games, and DVDs; craft activity kits; arts and crafts supplies, such as crayons, markers, and stickers; and trend-right items for school comprising backpacks, fashion notebooks and journals, novelty pens and pencils, locker accessories, and everyday name brand items. Further, the company provides party goods, decorations, gag gifts, and greeting cards, as well as every day and special occasion merchandise products; assortment of classic and novelty candy bars, movie-size box candy, seasonal-related candy, and gum and snack food; chilled drinks through coolers; and seasonally-specific items used to celebrate and decorate for events. It primarily serves tween and teen customers. As of January 29, 2022, the company operated approximately 1,190 stores in 40 states. The company was formerly known as Cheap Holdings, Inc. and changed its name to Five Below, Inc. in August 2002. Five Below, Inc. was incorporated in 2002 and is headquartered in Philadelphia, Pennsylvania.","Allegro MicroSystems, Inc. designs, develops, manufactures, and markets sensor integrated circuits (ICs) and application-specific analog power ICs for motion control and energy-efficient systems. Its products include magnetic sensor ICs, such as position, speed, and current sensor ICs; power ICs comprising motor driver ICs, and regulator and LED driver ICs; and photonic and 3D sensing components, including photodiodes, eye-safe lasers, and readout ICs for LiDAR applications. The company sells its products to original equipment manufacturers and suppliers primarily in the automotive and industrial markets through its direct sales force, third party distributors, independent sales representatives, and consignment. It operates in the United States, rest of the Americas, Europe, Japan, Greater China, South Korea, and other Asian markets. The company was founded in 1990 and is headquartered in Manchester, New Hampshire. Allegro MicroSystems, Inc. is a subsidiary of Sanken Electric Co., Ltd.","Chuy's Holdings, Inc., through its subsidiaries, owns and operates full-service restaurants under the Chuy's name in the United States. As of December 26, 2021, it operated 96 restaurants in 17 states, including the Southeastern and Midwestern United States. The company was founded in 1982 and is headquartered in Austin, Texas.","Starbucks Corporation, together with its subsidiaries, operates as a roaster, marketer, and retailer of specialty coffee worldwide. The company operates through three segments: North America, International, and Channel Development. Its stores offer coffee and tea beverages, roasted whole beans and ground coffees, single serve products, and ready-to-drink beverages; and various food products, such as pastries, breakfast sandwiches, and lunch items. The company also licenses its trademarks through licensed stores, and grocery and foodservice accounts. The company offers its products under the Starbucks, Teavana, Seattle's Best Coffee, Evolution Fresh, Ethos, Starbucks Reserve, and Princi brands. As of October 3, 2021, it operated 16,826 company-operated and licensed stores in North America; and 17,007 company-operated and licensed stores internationally. The company was founded in 1971 and is based in Seattle, Washington.","CSG Systems International, Inc. provides revenue management and digital monetization, customer engagement, and payment solutions primarily to the communications industry in the Americas, Europe, the Middle East, Africa, and the Asia Pacific. It offers Advanced Convergent Platform, a private SaaS based platform; related solutions, including field force automation, analytics, electronic bill presentment, ACH, etc. to the North American cable and satellite markets. The company also provides managed services; and professional services to implement, configure, and maintain its solutions, as well as licenses various solutions, such as mediation, partner management, rating, and charging. It serves retail, financial services, healthcare, insurance, and government entities. The company was incorporated in 1994 and is headquartered in Greenwood Village, Colorado.","Ralph Lauren Corporation designs, markets, and distributes lifestyle products in North America, Europe, Asia, and internationally. The company offers apparel, including a range of men's, women's, and children's clothing; footwear and accessories, which comprise casual shoes, dress shoes, boots, sneakers, sandals, eyewear, watches, fashion and fine jewelry, scarves, hats, gloves, and umbrellas, as well as leather goods, such as handbags, luggage, small leather goods, and belts; home products consisting of bed and bath lines, furniture, fabric and wallcoverings, lighting, tabletop, kitchen linens, floor coverings, and giftware; and fragrances. It sells apparel and accessories under the Ralph Lauren Collection, Ralph Lauren Purple Label, Polo Ralph Lauren, Double RL, Lauren Ralph Lauren, Polo Golf Ralph Lauren, Ralph Lauren Golf, RLX Ralph Lauren, Polo Ralph Lauren Children, and Chaps brands; women's fragrances under the Ralph Lauren Collection, Woman by Ralph Lauren, Romance Collection, and Ralph Collection brand names; and men's fragrances under the Polo Blue, Ralph's Club, Safari, Purple Label, Polo Red, Polo Green, Polo Black, Polo Sport, and Big Pony Men's brand names. The company's restaurant collection includes The Polo Bar in New York City; RL Restaurant in Chicago; Ralph's in Paris; The Bar at Ralph Lauren located in Milan; and Ralph's Coffee concept. It sells its products to department stores, specialty stores, and golf and pro shops, as well as directly to consumers through its retail stores, concession-based shop-within-shops, and its digital commerce sites. The company directly operates 504 retail stores and 684 concession-based shop-within-shops; and operates 175 Ralph Lauren stores, 329 factory stores, and 148 stores and shops through licensing partners. Ralph Lauren Corporation was founded in 1967 and is headquartered in New York, New York.","Diamond Hill Investment Group, Inc., through its subsidiary, Diamond Hill Capital Management, Inc., provides investment advisory and fund administration services in the United States. It sponsors, distributes, and offers investment advisory and related services to its clients through pooled investment vehicles, including the Diamond Hill Funds, separately managed accounts, and model delivery programs. The company also provides fund administration services, including portfolio and regulatory compliance, treasury and financial oversight, and general business management and governance of the mutual fund complex, as well as oversight of back-office service providers, such as the custodian, fund accountant, and transfer agent. The company was founded in 1990 and is based in Columbus, Ohio.","CPS Technologies Corporation produces and sells advanced material solutions to the transportation, automotive, energy, computing/internet, telecommunication, aerospace, defense, and oil and gas markets. It primarily offers metal matrix composites that are a combination of metal and ceramic, such as baseplates for various applications, including motor controllers used in electric trains, subway cars, wind turbines, and hybrid and electric vehicles; hermetic packages for use in radar, satellite, and avionics applications; baseplates and housings used in modules built with wide band gap semiconductors; and lids and heatspreaders used with integrated circuits for use in internet switches and routers. The company also assembles housings and packages for hybrid circuits. It primarily sells its products to microelectronics systems companies in the United States, Europe, and Asia. The company was formerly known as Ceramics Process Systems Corporation and changed its name to CPS Technologies Corporation in March 2007. CPS Technologies Corporation was incorporated in 1984 and is headquartered in Norton, Massachusetts.","Diodes Incorporated designs, manufactures, and supplies application-specific standard products in the discrete, logic, analog, and mixed-signal semiconductor markets worldwide. It focuses on low pin count semiconductor devices with one or more active or passive components. The company offers discrete semiconductor products, such as MOSFET, TVS, and performance Schottky rectifiers; GPP bridges and retifiers, and performance Schottky diodes; Zener and performance Zener diodes, including tight tolerance and low operating current type; standard, fast, super-fast, and ultra-fast recovery rectifiers; bridge rectifiers; switching diodes; small signal bipolar and prebiased transistors; thyristor surge protection devices; and transient voltage suppressors. It also provides analog products, such as power management devices comprising AC-DC and DC-DC converters, USB power switches, and low dropout and linear voltage regulators; linear devices, such as operational amplifiers and comparators, current monitors, voltage references, and reset generators; LED lighting drivers; audio amplifiers; and sensor products, including hall-effect sensors and motor drivers. The company offers mixed-signal products, such as high speed mux/demux products, digital switches, interfaces, redrivers, universal level shifters/voltage translator, clock ICs, and packet switches; standard logic products comprising low-voltage complementary metal\u0096oxide\u0096semiconductor (CMOS) and high-speed CMOS devices; ultra-low power CMOS logic products and analog switches; multichip products and co-packaged discrete, analog, and mixed-signal silicon in miniature packages; silicon and silicon epitaxial wafers; and crystals and oscillators. It sells its products to the consumer electronics, computing, communications, industrial, and automotive markets through direct sales, marketing personnel, independent sales representatives, and distributors. The company was incorporated in 1959 and is headquartered in Plano, Texas.","Dime Community Bancshares, Inc. operates as the holding company for Dime Community Bank that provides various commercial banking and financial services. It accepts time, savings, and demand deposits from the businesses, consumers, and local municipalities. The company also offers commercial real estate loans; multi-family mortgage loans; residential mortgage loans; secured and unsecured commercial and consumer loans; home equity loans; and construction and land loans. In addition, it invests in Federal Home Loan Bank, Federal National Mortgage Association, Government National Mortgage Association, and Federal Home Loan Mortgage Corporation mortgage-backed securities, collateralized mortgage obligations, and other asset backed securities; U.S. Treasury securities; New York state and local municipal obligations; U.S. government-sponsored enterprise securities; and corporate bonds. Further, the company offers certificate of deposit account registry services and insured cash sweep programs; merchant credit and debit card processing, automated teller machines, cash management services, lockbox processing, online banking services, remote deposit capture, safe deposit boxes, and individual retirement accounts; investment products and services through a third-party broker dealer; and title insurance broker services. As of December 31, 2021, it operated 60 branch locations throughout Long Island and the New York City boroughs of Brooklyn, Queens, Manhattan, and the Bronx. Dime Community Bancshares, Inc. was founded in 1910 and is headquartered in Hauppauge, New York.","Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. It provides infrastructure platforms, including networking technologies of switching, routing, wireless, and data center products that are designed to work together to deliver networking capabilities, and transport and/or store data. The company also offers collaboration products comprising unified communications, Cisco TelePresence, and conferencing, as well as the Internet of Things and analytics software. In addition, it provides security products, such as network security, cloud and email security, identity and access management, advanced threat protection, and unified threat management products. Further, the company offers a range of service and support options for its customers, including technical support and advanced services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.","Rockwell Automation, Inc. provides industrial automation and digital transformation solutions in the United States and internationally. The company operates in three segments, Intelligent Devices, Software &amp; Control, and Lifecycle Services. Its solutions include hardware and software products, and services. The Intelligent Devices segment offers drives, motion, safety, sensing, industrial components, and configured-to-order products. The Software &amp; Control segment provides control and visualization software and hardware, information software, digital twin and simulation software, and network and security infrastructure solutions. The Lifecycle Services segment provides consulting, professional services and solutions, and connected and maintenance services. The company sells its solutions primarily through independent distributors in relation with its direct sales force. It serves discrete end markets, including automotive, semiconductor, warehousing and logistics, and other discrete markets, as well as general industries comprising printing and publishing, marine, glass, fiber and textiles, airports, and aerospace; hybrid end markets, such as food and beverage, life sciences, household and personal care, and tire, as well as eco industrial, including water/wastewater, waste management, mass transit, and renewable energy; and process end markets comprising oil and gas, mining, metals, chemicals, pulp and paper, and others. Rockwell Automation, Inc. was founded in 1903 and is headquartered in Milwaukee, Wisconsin.","Energy Recovery, Inc., together with its subsidiaries, designs, manufactures, and sells various solutions for the seawater reverse osmosis desalination and industrial wastewater treatment industries worldwide. The company operates through Water and Emerging Technologies segments. It offers a suite of products, including energy recovery devices, and high-pressure feed and recirculation pumps; hydraulic turbochargers and boosters; and spare parts, as well as repair, field, and commissioning services. The company also offers a solution to reduce energy consumption in natural gas processing and in refrigeration systems that use carbon dioxide. It provides its products under the ERI, Ultra PX, PX, Pressure Exchanger, PX Pressure Exchanger, PX PowerTrain, VorTeq, IsoBoost, AT, and AquaBold names to large engineering, procurement, and construction firms; end-users and industry consultants; original equipment manufacturers; and aftermarket customers. The company was incorporated in 1992 and is headquartered in San Leandro, California.","ResMed Inc. develops, manufactures, distributes, and markets medical devices and cloud-based software applications for the healthcare markets. The company operates in two segments, Sleep and Respiratory Care, and Software as a Service. It offers various products and solutions for a range of respiratory disorders, including technologies to be applied in medical and consumer products, ventilation devices, diagnostic products, mask systems for use in the hospital and home, headgear and other accessories, dental devices, and cloud-based software informatics solutions to manage patient outcomes, as well as provides customer and business processes. The company also provides AirView, a cloud-based system that enables remote monitoring and changing of patients' device settings; myAir, a personalized therapy management application for patients with sleep apnea that provides support, education, and troubleshooting tools for increased patient engagement and improved compliance; U-Sleep, a compliance monitoring solution that enables home medical equipment (HME)to streamline their sleep programs; connectivity module and propeller solutions; and Propeller portal. It offers out-of-hospital software solution, such as Brightree business management software and service solutions to providers of HME, pharmacy, home infusion, orthotics, and prosthetics services; MatrixCare care management and related ancillary solutions to senior living, skilled nursing, life plan communities, home health, home care, and hospice organizations, as well as related accountable care organizations; and HEALTHCAREfirst that offers electronic health record, software, billing and coding services, and analytics for home health and hospice agencies. The company markets its products primarily to sleep clinics, home healthcare dealers, and hospitals through a network of distributors and direct sales force in approximately 140 countries. ResMed Inc. was founded in 1989 and is headquartered in San Diego, California.","Alphatec Holdings, Inc., a medical technology company, designs, develops, and advances technologies for the surgical treatment of spinal disorders. The company offers SafeOp Neural InformatiX System, an Alpha InformatiX product platform designed to reduce the risk of intraoperative nerve injury; Sigma transforaminal lumbar interbody fusion pedicle-based access system that provides direct visualization of anatomical landmarks; Sigma PTP Access and Patient Positioning System; squadron lateral retractor designed to maximize patient outcomes; Invictus Spinal Fixation System, a thoracolumbar fixation system to treat a range of pathologies; and Invictus MIS SingleStep System that provides minimally invasive pedicle screw placement. It also provides Invictus Modular Fixation Systems designed to increase adaptability with the power of screw modularity; OsseoScrew system to restore the integrity of the spinal column; Arsenal spinal fixation system, a comprehensive thoracolumbar fixation platform to fix a range of degenerative to deformity pathologies and surgical procedures; Aspida Anterior Lumbar Plating System, a fixation system for anterior lumbar interbody fusion; AMP Anti-Migration Plate; OCT Spinal Fixation System; trestle luxe anterior cervical plate system; and Insignia Anterior Cervical Plate System. In addition, the company offers IdentiTi Porous Ti, Transcend Lateral, and Battalion Posterior Interbody Implants; and biologics consisting of Cervical Structural Allograft Spacers, 3D ProFuse Demineralized Bone Scaffold, Neocore Osteoconductive Matrix, Alphagraft Demineralized and Cellular Bone Matrix, and Amnioshield Amniotic Tissue Barrier, as well as EOS imaging products. It sells its products through a network of independent distributors and direct sales representatives in the United States. The company was founded in 1990 and is headquartered in Carlsbad, California.","Caesarstone Ltd., together with its subsidiaries, develops, manufactures, and markets engineered quartz and other surfaces under the Caesarstone brand in the United States, Australia, Canada, Latin America, Asia, Israel, Europe, the Middle East, and Africa. The company's engineered quartz slabs are primarily used as indoor and outdoor kitchen countertops in the renovation and remodeling construction end markets. Its products are also used in other applications, such as vanity tops, wall panels, back splashes, floor tiles, stairs, furniture, and other interior and exterior surfaces that are used in various residential and non-residential applications. The company also offers porcelain products under the Lioli brand for flooring and cladding applications, as well as resells natural stones, various ancillary fabrication tools, and installation accessories; and sells sinks and materials. It sells its products directly to fabricators, sub-distributors, and resellers; and through direct sales force and indirect network of independent distributors. The company was formerly known as Caesarstone Sdot Yam Ltd. and changed its name to Caesarstone Ltd. in June 2016. Caesarstone Ltd. was founded in 1987 and is headquartered in Menashe, Israel.","Mondelez International, Inc., through its subsidiaries, manufactures, markets, and sells snack food and beverage products in the Latin America, North America, Asia, the Middle East, Africa, and Europe. It provides biscuits, including cookies, crackers, and salted snacks; chocolates; and gums and candies, as well as various cheese and grocery, and powdered beverage products. The company's snack brand portfolio includes Cadbury, Milka, and Toblerone chocolates; Oreo, belVita, and LU biscuits; Halls candies; Trident gums; and Tang powdered beverages. It serves supermarket chains, wholesalers, supercenters, club stores, mass merchandisers, distributors, convenience stores, gasoline stations, drug stores, value stores, and other retail food outlets through direct store delivery, company-owned and satellite warehouses, third party distributors, and other facilities, as well as through independent sales offices and agents, and e-commerce channels. The company was formerly known as Kraft Foods Inc. and changed its name to Mondelez International, Inc. in October 2012. Mondelez International, Inc. was incorporated in 2000 and is headquartered in Chicago, Illinois.","Dropbox, Inc. provides a content collaboration platform worldwide. Its platform allows individuals, families, teams, and organizations to collaborate and sign up for free through its website or app, as well as upgrade to a paid subscription plan for premium features. As of December 31, 2021, the company had approximately 700 million registered users. It serves customers in professional services, technology, media, education, industrial, consumer and retail, and financial services industries. The company was formerly known as Evenflow, Inc. and changed its name to Dropbox, Inc. in October 2009. Dropbox, Inc. was incorporated in 2007 and is headquartered in San Francisco, California.","Enter
