prise Bancorp, Inc. operates as the holding company of Enterprise Bank and Trust Company that provides commercial banking products and services. It offers commercial and retail deposit products, including checking accounts, limited-transactional savings and money market accounts, commercial sweep products, and term certificates of deposit. The company also provides commercial real estate, commercial and industrial, commercial construction, residential, and consumer loans, as well as home equity loans and lines of credit. In addition, the company offers cash management services; wealth advisory and management services that include customized investment management and trust services to individuals, family groups, commercial businesses, trusts, foundations, non-profit organizations, and endowments; brokerage and management services to individual investors; insurance services; and voice, online, and mobile banking services. As of January 27, 2022, it had 26 full-service branches located in the Massachusetts communities of Acton, Andover, Billerica, Chelmsford, Dracut, Fitchburg, Lawrence, Leominster, Lexington, Lowell, Methuen, North Andover, Tewksbury, Tyngsborough, and Westford; and in the New Hampshire communities of Derry, Hudson, Nashua, Pelham, Salem, and Windham. The company was founded in 1989 and is headquartered in Lowell, Massachusetts.","Aethlon Medical, Inc., a medical technology company, focuses on developing products to diagnose and treat life and organ threatening diseases in the United States. The company develops Aethlon Hemopurifier, a clinical-stage immunotherapeutic device that removes tumor-derived exosomes and life-threatening viruses from the human circulatory system, including removal of COVID-19 virus, associated variants, and related exosomes. Aethlon Medical, Inc. has a collaboration with the University of Pittsburgh Medical Center Hillman Cancer Center for studies related to head and neck cancer. The company was founded in 1999 and is based in San Diego, California.","Cogent Communications Holdings, Inc., through its subsidiaries, provides high-speed Internet access, private network, and data center colocation space services in North America, Europe, Asia, South America, Australia, and Africa. The company offers on-net Internet access and private network services to law firms, financial services firms, and advertising and marketing firms, as well as heath care providers, educational institutions and other professional services businesses, other Internet service providers, telephone companies, cable television companies, Web hosting companies, media service providers, mobile phone operators, content delivery network companies, and commercial content and application service providers. It also provides Internet access and private network services to customers that are not located in buildings directly connected to its network; and on-net services to customers located in buildings that are physically connected to its network. In addition, the company offers off-net services to corporate customers using other carriers' circuits to provide the last mile portion of the link from the customers' premises to the network. Further, it operates data centers that allow its customers to collocate their equipment and access the network. The company operates 54 data centers and provides facilities to 3,035 buildings and on-net services to 1,817 to multi-tenant office buildings. It serves primarily to small and medium-sized businesses, communications service providers, and other bandwidth-intensive organizations. Cogent Communications Holdings, Inc. was founded in 1999 and is headquartered in Washington, the District of Columbia.","Air Products and Chemicals, Inc. provides atmospheric gases, process and specialty gases, equipment, and services worldwide. The company produces atmospheric gases, including oxygen, nitrogen, and argon; process gases, such as hydrogen, helium, carbon dioxide, carbon monoxide, syngas; specialty gases; and equipment for the production or processing of gases comprising air separation units and non-cryogenic generators for customers in various industries, including refining, chemical, gasification, metals, manufacturing, food and beverage, electronics, magnetic resonance imaging, energy production and refining, and metals. It also designs and manufactures equipment for air separation, hydrocarbon recovery and purification, natural gas liquefaction, and liquid helium and liquid hydrogen transport and storage. Air Products and Chemicals, Inc. has a strategic collaboration with Baker Hughes Company to develop hydrogen compression systems. The company was founded in 1940 and is headquartered in Allentown, Pennsylvania.","Daxor Corporation, a medical device company, provides blood volume measurement technology focused on blood volume testing. The company develops and markets BVA-100 Blood Volume Analyzer, a diagnostic blood test to provide safe, accurate, objective quantification of blood volume status and composition compared to patient-specific norms for used in a broad range of medical and surgical conditions. The company was formerly known as Idant Corporation and changed its name to Daxor Corporation in May 1973. Daxor Corporation was incorporated in 1971 and is headquartered in Oak Ridge, Tennessee.","Accolade, Inc., together with its subsidiaries, develops and provides technology-enabled solutions that help people to understand, navigate, and utilize the healthcare system and their workplace benefits in the United States. The company offers a platform with cloud-based technology and multimodal support from a team of health assistants and clinicians, including nurses, physician medical directors, and behavioral health specialists. It also provides second opinion consultation and health care decision support services. The company serves employers who provide their employees and their employees' families a single place to turn for their health, healthcare,  Other, Corporate and Eliminations segment owns the FOX Studios Lot that provides production and post-production services, including 15 sound stages, two broadcast studios, theaters and screening rooms, editing rooms, and other television and film production facilities in Los Angeles, California. The company was incorporated in 2018 and is based in New York, New York.","The First Bancshares, Inc. operates as the bank holding company for The First, A National Banking Association that provides general commercial and retail banking services. The company operates through three segments: Commercial/Retail Bank, Mortgage Banking Division, and Holding Company. It offers deposit services, including checking, NOW, and savings accounts; other time deposits, such as daily money market accounts and longer-term certificates of deposit; and individual retirement and health savings accounts. The company also provides commercial loans comprising secured and unsecured loans for working capital, business expansion, and purchase of equipment and machinery; consumer loans consisting of equity lines of credit, as well as secured and unsecured loans for financing automobiles, home improvements, education, and personal investments; and real estate construction and acquisition loans. In addition, it originates loans to purchase existing residential homes or construct new homes, and to refinance existing mortgages; and provides financial and wealth management services. Further, the company offers internet banking services, automated teller machines, voice response telephone inquiry services, commercial sweep accounts, cash management services, safe deposit boxes, merchant, mobile deposit, direct deposit of payroll and social security checks, automatic drafts for various accounts, and credit card services. It primarily serves small to medium-sized businesses, professional concerns, individuals, associations, organizations, and governmental authorities. As of December 31, 2021, the company operated 90 locations in Mississippi, Alabama, Florida, Georgia, and Louisiana. The First Bancshares, Inc. was incorporated in 1995 and is headquartered in Hattiesburg, Mississippi.","The First Bancorp, Inc. operates as the holding company for First National Bank that provides a range of banking products and services to individuals and businesses. It offers various deposit products, including demand, NOW, savings, money market, and certificates of deposit accounts. The company also provides commercial real estate loan products, such as mortgage loans to finance investments in real property comprising multi-family residential, commercial/retail, office, industrial, hotel, educational, and other specific or mixed use properties; commercial construction loans to finance construction of owner- and non-owner occupied commercial real estate properties; and other commercial loans, which include revolving and term loan obligations to business and corporate enterprises for the purpose of financing working capital or capital investment. In addition, it offers municipal loans for capitalized expenditures, construction projects, or tax-anticipation notes; residential term loans that include amortizing home mortgages and construction loans, which include loans for owner-occupied residential construction; home equity loans and lines of credit; and consumer loans, which are amortizing loans to individuals collateralized by automobiles, pleasure crafts, and recreation vehicles, as well as unsecured short-term time notes. Further, the company provides private banking, financial planning, investment management, and trust services to individuals, businesses, non-profit organizations, and municipalities, as well as payment processing services. It operates through 18 full-service banking offices in Lincoln, Knox, Waldo, Penobscot, Hancock, and Washington counties in the Mid-Coast, Eastern, and Down East regions of Maine. The company was formerly known as First National Lincoln Corporation na.",null,"Canadian Solar Inc., together with its subsidiaries, designs, develops, manufactures, and sells solar ingots, wafers, cells, modules, and other solar power and battery storage products in Asia, the Americas, Europe, and internationally. The company operates through two segments, Canadian Solar Inc. (CSI) Solar and Global Energy. The CSI Solar segment offers standard solar modules and battery storage solutions, as well as solar system kits that are a ready-to-install packages comprising inverters, racking systems, and other accessories; and engineering, procurement, and construction (EPC) services. The Global Energy segment engages in the development, construction, maintenance, and sale of solar and battery storage projects; operation of solar power plants; and sale of electricity. This segment also provides operation and maintenance (O&amp;M) services, including monitoring, inspections, repair, and replacement of plant equipment; and site management and administrative support services for solar projects, as well as asset management services. As of January 31, 2021, this segment had a fleet of solar power plants in operation with an aggregate capacity of approximately 445 MWp. The company serves distributors, system integrators, project developers, and installers/EPC companies. It sells its products primarily under its Canadian Solar brand name; and on an OEM basis. The company was incorporated in 2001 and is headquartered in Guelph, Canada.","Steel Connect, Inc., together with its subsidiaries, provides direct marketing and supply chain services in the United States, Mainland China, and internationally. The company provides data-driven marketing solutions, including strategy, data and analytics, response analysis, creative services, lithographic and digital printing, envelope printing and converting, component manufacturing, promotional cards, data processing and hygiene, content and asset management, personalization, lettershop and bindery, and postal optimization and omnichannel marketing campaigns, as well as provides business continuity and disaster recovery services. It also offers product configuration and packaging, kitting, and assembly of components and parts into finished goods; and value-added processes, such as product testing, radio frequency identification tagging, product or service activation, language settings, personalization and engraving, multi-channel packaging, and packaging design services. In addition, the company provides fulfillment services comprising order management, pick, pack and ship, retail compliance, and demand planning services; and reverse logistics services that simplifies the returns process for retailers and manufacturers, as well as operates a cloud-based e-commerce platform. Steel Connect, Inc. offers its supply chain services to customers in the consumer electronics, communications, computing, medical devices, software, and retail markets. The company was formerly known as ModusLink Global Solutions, Inc. and changed its name to Steel Connect, Inc. in February 2018. Steel Connect, Inc. was incorporated in 1986 and is headquartered in Smyrna, Tennessee.","CommScope Holding Company, Inc. provides infrastructure solutions for communications and entertainment networks. It operates through four segments: Broadband Networks (Broadband), Outdoor Wireless Networks (OWN), Venue and Campus Networks (VCN), and Home Networks (Home). The Broadband segment provides converged cable access platforms, passive optical networking products, video systems, access technologies, fiber and coaxial cables, fiber and copper connectivity products, and hardened closures to the telco and cable provider broadband market. The OWN segment provides base station antennas, radio frequency filters, tower connectivity, microwave antennas, metro cell products, cabinets, steel towers, accessories, Spectrum Access System, and Comsearch products to the macro and metro cell markets. The VCN segment offers Wi-Fi and switching, distributed antenna systems, licensed and unlicensed small cells, enterprise fiber, and copper infrastructures for campuses, venues, data centers, and buildings. The Home segment provides devices and related software, and management solutions that offer residential connectivity and services to subscribers, such as digital subscriber lines, cable modems, and telephony and data gateways; and set top boxes and software that support cable, satellite, and Internet protocol television content delivery, which include digital video recorders, high definition set top boxes, and hybrid set top devices. It offers its products and services through specialized resellers and distributors, satellite video distributors, and system integrators, as well as directly to customers in the United States, Europe, the Middle East, Africa, the Asia Pacific, the Caribbean, Latin America, and Canada. The company was formerly known as Cedar I Holding Company, Inc. and changed its name to CommScope Holding Company, Inc. in January 2011. CommScope Holding Company, Inc. was founded in 1976 and is headquartered in Hickory, North Carolina.","Commercial Vehicle Group, Inc., together with its subsidiaries, designs, manufactures, produces, and sells components and assemblies in North America, Europe, and the Asia-Pacific regions. It operates in four segments: Vehicle Solutions, Warehouse Automation, Electrical Systems, and Aftermarket &amp; Accessories. The company offers electrical wire harness assemblies that function as current carrying devices in providing electrical interconnections for gauges, lights, control functions, power circuits, powertrain and transmission sensors, emissions systems, and other electronic applications on commercial and other vehicles; and panel assemblies. It also offers electro-mechanical assemblies, such as box builds, complex automated and robotic assemblies, and large multi-cabinet control cabinets with power distribution and cabling; vinyl or cloth-covered appliqu\u00e9s, armrests, map pocket compartments, and sound-reducing insulations; instrument panels; and plastics decorating and finishing products. In addition, it provides cab structures; design products, including armrests, grab handles, storage systems, floor coverings, floor mats, sleeper bunks, headliners, wall panels, and privacy curtains; and mirrors, wipers, and controls used in commercial, military and specialty recreational vehicles. Further, it offers seats and seating systems, such as mechanical and air suspension, static and military seats, and bus, as well as seats for medium-and heavy-duty trucks (MD/HD trucks); office seating products; and seats, parts, and components for the aftermarket. The company supplies its products and systems for the commercial vehicle market comprising the MD/HD truck market; and MD/HD truck, bus, construction, mining, agricultural, military, industrial, municipal, off-road recreational, and specialty vehicle markets. Commercial Vehicle Group, Inc. was incorporated in 2000 and is headquartered in New Albany, Ohio.","DocGo, Inc. provides mobile health and medical transportation services for various health care providers in the United States and the United Kingdom. The company's transportation services include emergency response services; and non-emergency transport services comprise ambulance and wheelchair transportation services. It also offers mobile health services through its platform that are performed at home and offices; COVID-19 testing; and event services, which include on-site healthcare support at sporting events and concerts. DocGo, Inc. was incorporated in 2015 and is headquartered in New York, New York.","Cumberland Pharmaceuticals Inc., a specialty pharmaceutical company, focuses on the acquisition, development, and commercialization of prescription products for hospital acute care, gastroenterology, rheumatology, and oncology in the United States and internationally. The company offers Acetadote, an injection for the treatment of acetaminophen poisoning; Caldolor, an injection for the treatment of pain and fever; Kristalose, a prescription laxative oral solution for the treatment of chronic and acute constipation; Omeclamox-Pak for the treatment of Helicobacter pylori infection and duodenal ulcer disease; Vaprisol, an injection for treating euvolemic and hypervolemic hyponatremia; and Vibativ, an injection for the treatment of certain serious bacterial infections, including hospital-acquired and ventilator-associated bacterial pneumonia, as well as complicated skin and skin structure infections. It also develops RediTrex injection for the treatment of active rheumatoid, juvenile idiopathic, and severe psoriatic arthritis, as well as disabling psoriasis. In addition, the company is developing ifetroban, a product candidate that is in phase II clinical trial for the treatment of aspirin-exacerbated respiratory disease, systemic sclerosis, and duchenne muscular dystrophy; and has completed phase II clinical trial for the treatment of hepatorenal syndrome and portal hypertension. Further, it develops a clinical program for the use of ifetroban to treat progressive fibrosing interstitial lung diseases; and a product candidate that is in Phase II clinical trial for cholesterol reducing agent to use in the hospital setting. The company was incorporated in 1999 and is headquartered in Nashville, Tennessee.","Cricut, Inc. designs and markets a creativity platform that enables users to turn ideas into professional-looking handmade goods. It operates in three segments: Connected Machines, Subscriptions, and Accessories and Materials. The company offers connected machines, design apps, and accessories and materials for users to create personalized birthday cards, mugs, T-shirts, and large-scale interior decorations. Its connected machines include Cricut Joy, Cricut Explore, and Cricut Maker to cut, write, score, and create decorative effects using various materials, such as paper, vinyl, leather, and others; and design apps comprise Design Space app and Cricut Joy-specific app. The company also provides Cricut Access and Cricut Access Premium subscription offerings, and in-app purchases; and a software that integrates its connected machines and design apps. In addition, it offers a range of accessories and materials, such as Cricut EasyPress, Cricut Mug Press, various hand tools, machine replacement tools and blades, and project materials. The company offers its products through its third-party brick-and-mortar and online retail partners; and its website cricut.com, as well as through a network of distributors. It operates in the United States, the United Kingdom, Ireland, Australia, New Zealand, and Western Europe, as well as the Middle East, Latin America, South Africa, and Asia. The company was formerly known as Provo Craft &amp; Novelty, Inc. and changed its name to Cricut, Inc. in March 2018. The company was incorporated in 1969 and is headquartered in South Jordan, Utah.","Arqit Quantum Inc. provides cybersecurity services through satellite and terrestrial platforms in the United Kingdom. It offers QuantumCloud that enables any device to download a lightweight software agent, which can create encryption keys in partnership with any other device. The company is based in London, the United Kingdom."],"shape":[79],"dtype":"object","order":"little"}],["ceo",{"type":"ndarray","array":["Mr. Jeffrey Allen Miller","Mr. Randall D. Sampson CPA","Mr. Joseph M. Hogan","Mr. Robert Kipp DeVeer III","Mr. Ricardo  Cardenas","Mr. William P. Stafford II","Mr. Rohit  Kapoor","Mr. Ganesh  Moorthy","Mr. Antonio Fabio Neri","Mr. John Quinlan Doyle","Mr. Vincent T. Roche","Mr. David J. Deno","Mr. Satish C. Dhanasekaran","Mr. Andrew Ryan Schlossberg","Mr. Richard J. O'Neil Jr.","Mr. Jon R. Moeller","Mr. Corey A. Chambas","Mr. Craig L. Kauffman","Mr. Timothy P. Boyle","Mr. Gary S. Olson","Mr. Haviv  Ilan","Mr. Domenic J. Dell'Osso Jr.","Mr. Brendan M. Foley",
